import React from "react";
import { Person } from "../types/personType";

interface Props {
  people: Person[];
}

const List: React.FC<Props> = ({ people }) => {
  console.log(people);
  return (
    <div>
      {people.map((person) => {
        return (
          <div className="card">
            {person.url}
            {person.name}
          </div>
        );
      })}
    </div>
  );
};

export default List;
